How to put a fetch request inside a function and wait for the return value when I call the function<p>I am using react-native, mongo DB and node js and I need to create some database functions and put them in some modules to be able to reuse them whenever I want. To fetch data from the mongo database, I use the <code>fetch()</code> function which returns a promise. So, for all functions that I created that did not return a value, I used <code>.then</code> and I faced no problems. On the other side, when I return a value inside a <code>fetch().then()</code> function and use this returned value, I get undefined. The code I use for the function looks like:</p>
<pre><code>export const getUsers = () =&gt; {
  //I cannot use this function because of returning a promise
  fetch(&quot;http://1jjsd12zaws.ngrok.io/database/&quot;, {
    method: &quot;GET&quot;,
    headers: {
      &quot;Content-Type&quot;: &quot;application/json&quot;,
    },
  })
    .then((res) =&gt; {
      res.json();
    })
    .then((data) =&gt; {
      return JSON.stringify(data);
    });
};
</code></pre>
<p>Then, when I try to run this code:</p>
<pre><code>let users=getUsers();
console.log(users);
</code></pre>
<p>It prints <code>undefined</code>.</p>
<p>What I think is going on is that the <code>console.log(users)</code> runs before <code>getUsers()</code> returns its value. But I do not know why does this happen and I want it to wait for <code>getUsers()</code> to execute then, completes its work.</p>

