how to use mongoose aggregate to search an array within a collection<p>I am trying to group by products in my sales collection and add their totals to know which are the best selling products of my app.</p>
<p><strong>MONGOOSE MODEL</strong></p>
<pre><code>const mongoose = require('mongoose');
</code></pre>
<p>const DHCustomerinvoiceSchema = mongoose.Schema({</p>
<pre><code>    Saledetail: {
        type: Array,
        required: true
    }, 
    date:{
       type: Date,
       required: true     
   },
   total:{
        type: Number,
        required: true  
   },
   pay:{
    type: Number,
    required: true,
    default: 0 
   },
   topay:{
     type: Number,
     required: true 
   },
   user:{
    type: mongoose.Schema.Types.ObjectId,
    required: true,
    ref: 'UserDH'
   },
   customer:{
       type: mongoose.Schema.Types.ObjectId,
       required: true,
       ref: 'DHcontacto'
   },
   state:{
       type: String,
       default: &quot;OWED&quot;  
   },
   created:{
    type: Date,
    default: Date.now()
   },


});

module.exports = mongoose.model('DHCustomerinvoice', DHCustomerinvoiceSchema);
</code></pre>
<p><strong>COLLECTION EXAMPLE</strong></p>
<pre><code>{
    &quot;id&quot;: &quot;5ef6*****&quot;,
    &quot;Saledetail&quot;: [
      {
        &quot;id&quot;: &quot;5ebf*****&quot;,
        &quot;quantity&quot;: 9,
        &quot;price&quot;: 2000,
        &quot;totalline&quot;: 18000
      }
    ],
    &quot;datesale&quot;: &quot;1593129600000&quot;,
    &quot;grandtotal&quot;: 18000,
    &quot;user&quot;: &quot;5eb9ab******&quot;,
    &quot;customer&quot;: {
      &quot;name&quot;: &quot;isabella&quot;
    },
    &quot;state&quot;: &quot;PAID&quot;
  },
</code></pre>
<p><strong>RESOLVER:</strong></p>
<pre><code>mostSellingProducts: async (_,{},ctx)=&gt;{   

                const Products = await invoice.aggregate([
                     { $unwind: &quot;$Saledetail&quot; },
                     { $match: { &quot;state&quot; : 'PAID'}},
                     { $group: {
                        _id : &quot;$Saledetail.id&quot;,
                        total: { $sum: '$Saledetail.totalline' }
                    }},
                    {
                        $lookup: {
                            from: 'dhproducts',
                            localField: '_id',
                            foreignField: &quot;_id&quot;,
                            as: &quot;producto&quot; 
                        }
                    },
                    {
                        $limit: 4
                    },
                    {
                        $sort : {total: -1}
                    }
                    ]);
                console.log(Products);
                return Products;
   },
</code></pre>
<p>I have used many methods that actually did not give me this result, but nevertheless I have achieved a positive result in terms of finding my best clients who actually develop it with aggregate, match and group also apply sort and limit ...
but with this example I have not been able to achieve success, and I imagine that it is because the architecture of the collection is distinguished due to the arrangement of the purchase detail</p>

