How to push a new value to an array if the current value is an array or set the value as an array if it is not in a single MongoDB Query<p>I have a project where we have been using simple, unversioned values for documents:</p>
<pre class="lang-js prettyprint-override"><code>{
  _id: &lt;someid&gt;,
  prop1: 'foo',
  prop2: 'bar',
  prop3: 'baz'
}
</code></pre>
<p>I would like to update the method that saves prop values to start saving values as versions in an array, to look like this:</p>
<pre><code>{
  _id: &lt;someid&gt;,
  prop1: [{ value: 'foo', createdAt: &lt;someDate&gt;}],
  prop2: [{ value: 'bar', createdAt: &lt;someDate&gt;}, { value: 'barrrrr', createdAt: &lt;someDate&gt;}],
  prop3: 'baz'
}
</code></pre>
<p>I would like, in my update query, to <code>$push</code> the new prop value object <em>if</em> it's already an array, or to <code>$set</code> it to `[{ value: 'newvalue', createdAt: +new Date()}] if not. Ideally, this would let me seamlessly transition the data to be versioned over time. On the retrieval side, if it's not an array we just treat the only value that's there as the reference version, and whenever anything gets updated, that prop is converted to the new format.</p>
<p>I've been struggling to find an example of that same use case: can anyone point me in the right direction?</p>
<p>UPDATE:</p>
<p>After being pointed in the right direction, I was able to use the aggregation pipeline in combination with update to do what I wanted. Part of the key was to abandon trying to pivot between setting and pulling--instead, I could use the helper method <code>$concatArrays</code> to accomplish the array addition a different way. Here's the basic shell code I got to work, purely to show the structure:</p>
<pre class="lang-js prettyprint-override"><code>db.test.docs.update({ key: 2 }, [
  {
    $set: {
      prop2: {
        $cond: {
          if: { $isArray: '$prop2' },
          then: {
            $concatArrays: [
              '$prop2',
              [
                {
                  value: 'CONCAT!'
                }
              ]
            ]
          },
          else: [
            {
              value: 'SET!'
            }
          ]
        }
      }
    }
  }
]);
</code></pre>

