MongoDb Aggregation: How can I group an array-1 based on another array-2 when given array-1 and array-2?<p>EDIT: My original question was</p>
<blockquote>
<p>MongoDb Aggregation: Can you $unwind an input document variable in the pipline of a $lookup stage?</p>
</blockquote>
<p>Consider the code below:</p>
<pre><code>{$lookup: {
    from:&quot;mydoc&quot;, 
    let: {&quot;c&quot;:&quot;$myArray&quot;}, 
    pipeline: [ 
        {$unwind: &quot;$$c&quot;},
    ]
    as:&quot;myNewDoc&quot;
 }}
</code></pre>
<p>How would I unwind <code>c</code> if I wanted to?</p>
<p>/////END OF ORIGINAL QUESTION</p>
<h2><strong>-----EDIT-----</strong></h2>
<p>From Tom Slabbaert's comment we now know that it is possible to $unwind an input document variable in the pipline of a $lookup stage. But it is not recommended.</p>
<blockquote>
<p>What am I trying to achieve?</p>
</blockquote>
<p>Consider these collections, <code>poll</code> and <code>castedvote</code> from <a href="https://stackoverflow.com/a/60767035/9953550">this answer</a> from <a href="https://stackoverflow.com/q/60740127/9953550">a question I had asked</a>.</p>
<p>I am trying to get an output like below:</p>
<pre><code>numberOfVotes: 6,
hasThisUserVoted: true,
numberOfComments: 12,
castedVotesPerChoice:{
    &quot;choiceA&quot;: [
        {&quot;_id&quot;: ObjectId(&quot;...&quot;), &quot;voter&quot;: &quot;Juzi&quot;, &quot;choice&quot;: 0, &quot;pollId&quot;: 100 },
        {&quot;_id&quot;: ObjectId(&quot;...&quot;), &quot;voter&quot;: &quot;Juma&quot;, &quot;choice&quot;: 0, &quot;pollId&quot;: 100 },
        {&quot;_id&quot;: ObjectId(&quot;...&quot;), &quot;voter&quot;: &quot;Jane&quot;, &quot;choice&quot;: 0, &quot;pollId&quot;: 100 },
    ],
    &quot;choiceB&quot;: [
        {&quot;_id&quot;: ObjectId(&quot;...&quot;), &quot;voter&quot;: &quot;Jamo&quot;, &quot;choice&quot;: 1, &quot;pollId&quot;: 100 },
        {&quot;_id&quot;: ObjectId(&quot;...&quot;), &quot;voter&quot;: &quot;Juju&quot;, &quot;choice&quot;: 1, &quot;pollId&quot;: 100 },
        {&quot;_id&quot;: ObjectId(&quot;...&quot;), &quot;voter&quot;: &quot;Jana&quot;, &quot;choice&quot;: 1, &quot;pollId&quot;: 100 }
    ],
    &quot;choiceC&quot;: [ ]
}
</code></pre>
<p>my current implementation:</p>
<pre><code>db.poll.aggregate([
    {&quot;$match&quot;: {&quot;_id&quot;: 100}}, 
    // ...lookup to get comments
    {&quot;$lookup&quot;: {
        &quot;from&quot;:&quot;castedvotes&quot;, 
        &quot;let&quot;: {&quot;pollId&quot;:&quot;$_id&quot;}, 
        &quot;pipeline&quot;:[
            {&quot;$match&quot;:
                {&quot;$expr&quot;:
                    {&quot;$eq&quot;: [&quot;$pollId&quot;, &quot;$$pollId&quot;]},
            }},
        ], 
        &quot;as&quot;:&quot;votes&quot; // will use this to get number of votes and find out if the authenticated user has voted.
    }},
    {&quot;$unwind&quot;:&quot;$choices&quot;},
