        &quot;let&quot;: {&quot;c&quot;:&quot;$choices&quot;}, 
        &quot;pipeline&quot;:[
            {&quot;$match&quot;:
                {&quot;$expr&quot;:
                    {&quot;$eq&quot;: [&quot;$choice&quot;, &quot;$$c.id&quot;]},
            }},
        ], 
        &quot;as&quot;:&quot;votesPerChoice&quot;
    }},
])
</code></pre>
<p>The issue I have with my current implementation is that it is doing a lookup on the same collection twice I feel like this is unnecessary and it makes the code not dry.
With <code>$unwind</code> I know I can un-<code>$unwind</code> as described <a href="https://stackoverflow.com/questions/36786278/undo-unwind-in-aggregate-in-mongodb">here</a>.</p>
<p>So my question is how can I get my desired output with one $lookup to the casted vote collection? Since both lookups return the same data.</p>
<p>Or to ask the question differently how can I group an array-1 based on another array-2 in mongodb aggregation when given array-1 and array-2?</p>
