      { $project: { &quot;name&quot;: { $concat: [&quot;$firstName&quot;, &quot; &quot;, &quot;$lastName&quot;] } } },
      { $match: { &quot;name&quot;: { $regex: searchInput, $options: 'i' } } }
  ]).collation(
      { locale: 'en', strength: 2 }
  ).limit(limit).skip(offset);
</code></pre>
